import React from 'react';

const SimplePage = () => {
    return (
        <header className="font-montserrat">
            <div className="container px-[76px] py-3 bg-white text-[#999999] text-sm font-normal">
                <span>Ваш город: <span className="text-black font-medium">Москва</span></span>
                <nav className="">
                    <a href="#">Про анонимность</a>
                    <a href="#">Про анонимность</a>
                    <a href="#">Условия возврата</a>
                    <a href="#">FAQ</a>
                </nav>
            </div>
        </header>
    );
};

export default SimplePage;
